import * as React from "react";
// @ts-ignore
import styles from "./header.module.scss";
import { Nav } from "./nav/nav";

export const Header = () => {
  return (
    <header className={styles.container}>
      <div className={styles.content}>
        <Nav />
      </div>
    </header>
  );
};
